        things used to be missing from the world of expert beauty advice, according
        to 27-year-old Alba Ramos (@sunkissalba): chemical-free products that are
        actually available in Latin America, where she is from, and Spanish speakers.
        \u201cI grew up on an island, in the Dominican Republic, so our grandparents
        and ancestors used natural ingredients from the yard,\u201d says Alba. \u201cBut
        then we come to America, we fantasize about the American dream, and we kind
        of lose that.\u201d So, she started a Spanish-only beauty channel from her
        home in New York City, and began providing Spanish translations in her captions
        on Instagram. Her work focuses on DIY beauty solutions, like homemade facials
        and hair masks. \u201cA lot of my Spanish-speaking viewers write me saying
        that I\u2019m the only person online they\u2019ve ever seen embracing natural
